Notation: DOMAIN f LaTeX notation: DOMAIN f Arguments: One argument, which should be a function (respectively, a record, tuple, sequence). Effect: DOMAIN f returns the set of values, on which the function has been defined, see: Function constructor and Function set constructor. Determinism: Deterministic. Errors: In pure TLA+, the result is undefined, if f is not a function (respectively, a record, tuple, or sequence). TLC flags a model checking error if f is a value that does not have a domain. Apalache flags a type checking error. Example in TLA+: LET f == [ x \in 1..3 |-> 2 * x ] IN DOMAIN f \* { 1, 2, 3 } Example in Python: In the following code, we write range(m, n) instead of frozenset(range(m, n)) to simplify the presentation and produce idiomatic Python code. In the general case, we have to iterate over a set, as the type and structure of the function domain is not known in advance. >>> f = {x: 2 * x for x in range(1, 4)}
>>> f.keys()
dict_keys([1, 2, 3]) In the above code, we write f.keys() to obtain an iterable over the dictionary keys, which can be used in a further python code. In a more principled approach that follows the semantics of TLA+, we would have to produce a set, that is to write: frozenset(f.keys())

