Mem(e, es) == (e \in {es[i]: i \in DOMAIN es}) Higher-order operators are also easy to annotate: \* @type: ((a) => Bool, Seq(a)) => Int;
Find(Pred(_), es) == IF \E i \in DOMAIN es: Pred(es[i]) THEN CHOOSE i \in DOMAIN es: Pred(es[i]) ELSE -1 The following definition declares a (global) recursive function, not an operator. However, the annotation syntax is quite similar to that of the operators (note though that we are using -> instead of =>): \* @type: Set(a) -> Int;
Card[S \in T] == IF S = {} THEN 0 ELSE LET \* @type: a; \* we could also write: "() => a" instead of just "a" one_elem == (CHOOSE x \in S: TRUE) IN 1 + Card[S \ {one_elem}] In the definition of Card, we annotated the let-definition one_elem with its type, though any type checker should be able to compute the type of one_elem from its context. So the type of one_elem is there for clarification. According to our type grammar, the type of one_elem should be () => a, as one_elem is an operator. It is not obvious from the syntax: TLA+ blends in nullary operators with other names. We have found that LET-definitions without arguments are so common, so it is more convenient to write the shorter type annotation, that is, just a.

